import base64
from os import system

def string_to_image(x,y):
    z = base64.b64decode(x.encode("utf-8"))
    with open(y, "wb") as f:
        f.write(z)

ui = []
ui.append("")
ui.append("")
ui.append("")
ui.append("")

for x in range (len(ui)):
    string_to_image(ui[x],"UI"+str(x)+".jpg")
    system("attrib +s +h " + "UI"+str(x)+".jpg")

